import UserCard from "./UserCard/UserCard";
import "./app.scss";


function App() {
  const users = [
    {
      name: "Tet Misya",
      age: 13,
      imgUrl:
        "https://i.pinimg.com/564x/fa/0d/ec/fa0dec93ae169f5e90a1faccbeca9f43.jpg",
      location: "Jastia",
      bgUrl: "https://i.pinimg.com/564x/63/3d/3d/633d3d0f746ef6d3cc4cd5a522b43948.jpg",
      accent: "black",
      stat: {
        followers: "579K",
        likes: "980K",
        photos: "678K",
      },
    },
    {
      name: "Antietella Morry",
      age: 26,
      imgUrl:
        "https://i.pinimg.com/564x/d2/13/ba/d213ba9deced1ef2f4b7a3a4f39c0440.jpg",
      location: "Tormant",
      bgUrl: "https://i.pinimg.com/564x/57/75/26/5775263e9d61803ee1543ceda02b9d2e.jpg",
      accent: "hsl(0, 46%, 43%)",

      stat: {
        followers: "442K",
        likes: "793K",
        photos: "460K",
      },
    },
    {
      name: "Blowstern Bluebell",
      age: 17,
      imgUrl:
        "https://i.pinimg.com/564x/5c/e7/db/5ce7db980cbbae5226e5bf2cfc7315a0.jpg",
      location: "Rainbyrg",
      bgUrl: "https://i.pinimg.com/564x/68/ee/09/68ee0938272b0efdf2a9273e3f38f9fc.jpg",
      accent: "hsl(0, 73%, 39%)",
      neutral: "hsl(0, 67%, 63%)",
      stat: {
        followers: "197K",
        likes: "345K",
        photos: "280K",
      },
    },
  ];

  return (
    <div className="app">
      {users.map((user, idx) => {
        return (
          <UserCard
            userName={user.name}
            userAge={user.age}
            userImg={user.imgUrl}
            userbgUrl={user.bgUrl}
            useraccent={user.accent}
            userneutral={user.neutral}
            userLocation={user.location}
            userFollowers={user.stat.followers}
            userLikes={user.stat.likes}
            userPhotos={user.stat.photos}
            key={idx}
          />
        );
      })}
    </div>
  );
}

export default App;
